    // with a custom engine
    base64::decode_engine_vec(
        "aGVsbG8gaW50ZXJuZXR-Cg==",
        &mut buffer,
        &URL_SAFE_ENGINE
    ).unwrap();
    println!("{:?}", buffer);
}
```

